import React, { useState, useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import './EmployeeList.css';
import { fetchEmployees, deleteEmployee } from '../api';

const EmployeeList = () => {
  const [employees, setEmployees] = useState([]);
  const [error, setError] = useState('');
  const [searchTerm, setSearchTerm] = useState('');
  const navigate = useNavigate();

  useEffect(() => {
    const loadEmployees = async () => {
      try {
        const data = await fetchEmployees();
        console.log('Fetched employees:', data);
        setEmployees(data);
      } catch (error) {
        console.error('Error fetching employees:', error);
        setError('Failed to load employees');
      }
    };

    loadEmployees();
  }, []);

  const handleSearch = (e) => {
    setSearchTerm(e.target.value.toLowerCase());
  };

  const handleDelete = async (id) => {
    const confirmed = window.confirm('Are you sure you want to delete this employee?');
    if (confirmed) {
      try {
        await deleteEmployee(id);
        console.log('Employee deleted successfully');
        // Reload the employee list
        const data = await fetchEmployees();
        setEmployees(data);
      } catch (error) {
        console.error('Error deleting employee:', error);
        setError('Failed to delete employee');
      }
    }
  };

  const filteredEmployees = employees.filter(emp =>
    emp.f_Name.toLowerCase().includes(searchTerm)
  );

  return (
    <div className="employee-list-container">
      <div className="employee-list-header">
        <div className="search-bar">
          <input
            type="text"
            placeholder="Search by name"
            value={searchTerm}
            onChange={handleSearch}
          />
        </div>
        <div className="header-right">
          <span>{filteredEmployees.length} Employees</span>
          <Link to="/create-employee" className="create-button">Create Employee</Link>
        </div>
      </div>
      {error && <div className="error">{error}</div>}
      {filteredEmployees.length === 0 ? (
        <p>No employees found.</p>
      ) : (
        <table>
          <thead>
            <tr>
              <th>Unique Id</th>
              <th>Image</th>
              <th>Name</th>
              <th>Email</th>
              <th>Mobile No</th>
              <th>Designation</th>
              <th>Gender</th>
              <th>Course</th>
              <th>Create Date</th>
              <th>Action</th>
            </tr>
          </thead>
          <tbody>
            {filteredEmployees.map((emp) => (
              <tr key={emp._id}>
                <td>{emp._id}</td>
                <td><img src={emp.f_Image} alt={emp.f_Name} /></td>
                <td>{emp.f_Name}</td>
                <td>{emp.f_Email}</td>
                <td>{emp.f_Mobile}</td>
                <td>{emp.f_Designation}</td>
                <td>{emp.f_gender}</td>
                <td>{emp.f_Course.join(', ')}</td>
                <td>{new Date(emp.f_Createdate).toLocaleDateString()}</td>
                <td>
                  <Link to={`/employee-edit/${emp._id}`}>Edit</Link> - 
                  <button onClick={() => handleDelete(emp._id)}>Delete</button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
};

export default EmployeeList;
